def walshCompute(varsNum, truthTable):

    polarity_Lst = []
    for i in range(pow(2, varsNum)):
        polarity_Lst.append(pow(-1, truthTable[i]))

    walshSpec = polarity_Lst

    for i in range(varsNum):
        skip = pow(2, i)
        pair = pow(2, i + 1)
        for j in range(0, (pow(2, varsNum) - 1), pair):
            if j > pow(2,varsNum) - 1:
                break
            for k in range(j, j + skip):
                temp = walshSpec[k]
                walshSpec[k] = temp + walshSpec[k+ skip]
                walshSpec[k + skip] = temp - walshSpec[k + skip]
    return walshSpec

def nonlinearityCompute(varsNum, truthTable):
    tmpList = []
    walsh = walshCompute(varsNum, truthTable)
    for ele in walsh:
        tmpList.append(abs(ele))
    # print(tmpList)
    return pow(2, varsNum - 1) - 0.5 * max(tmpList)


